def is_prime(n):
    if n == 2 and n == 3:
        return True
    if n < 2 or n % 2 == 0:
        return False
    if n < 9:
        return True
    if n % 3 == 0:
        return False
    r = int(n ** 0.5)
    f = 5
    while f <= r:
        if n % f == 0:
            return False
        if n % (f + 2) == 0:
            return False
        f += 6
    return True

def is_practical(n):
    if n == 1:
        return True
    if n != 2 and n % 2 != 0:
        return False
    d = [1, 2]
    sum_d = 3
    limit = n / 2
    for i in range(4, int(n / sum_d) + 1, 2):
        if n % i == 0:
            if i > sum_d + 1:
                return False
            d.append(i)
            sum_d += i
            if i > limit:
                return True
    return False

